from typing import List


class Solution:
    def missingElement(self, nums: List[int], k: int) -> int:
        point=0
        st=nums[0]
        cur=1
        l=len(nums)
        while point!=k:
            st+=1
            if l>cur and st == nums[cur]:
                cur+=1
            else:
                point+=1
        return st




